import React from 'react';
import './index.css';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';

import { Modal, Button, Form, Input, Select} from 'antd';


class Formulario extends React.Component {

  render() {

    return (
      <Form labelCol={{ span: 5 }} wrapperCol={{ span: 12 }} onSubmit={this.handleSubmit}>
        <Form.Item label="Nome">
          {getFieldDecorator('nome', {
            rules: [{ required: true, message: 'Por favor, insira os dados!' }],
          })(<Input />)}
        </Form.Item>
        <Form.Item label="Telefone">
          {getFieldDecorator('telefone', {
            rules: [{ required: true, message: 'Por favor, insira os dados!' }],
          })(<Input />)}
        </Form.Item>
        <Form.Item label="E-mail">
          {getFieldDecorator('e-mail', {
            rules: [{ required: true, message: 'Por favor, insira os dados!' }],
          })(<Input />)}
        </Form.Item>

      </Form>
    );
  }
}

const WrappedApp = Form.create({ name: 'coordinated' })(Formulario);



class App extends React.Component {
  state = { visible: false };

  handleSubmit = e => {
    e.preventDefault();
    this.props.form.validateFields((err, values) => {
      if (!err) {
        console.log('Valores recebidos do formulário: ', values);
      }
    });
  };

  showModal = () => {
    this.setState({
      visible: true,
    });
  };

  handleOk = e => {
    console.log(e);
    this.setState({
      visible: false,
    });
  };

  handleCancel = e => {
    console.log(e);
    this.setState({
      visible: false,
    });
  };

  render() {
    const { getFieldDecorator } = this.props.form;
    return (
      <div>
        <h1 className="titulo" >Clientes do sistema</h1>
        <Button type="primary" className="mod" onClick={this.showModal}>
          Cadastrar
        </Button>
        <Modal
            title="Cadastro de cliente"
            visible={this.state.visible}
            onOk={this.handleOk}
            onCancel={this.handleCancel}
        >
            <WrappedApp/>
        </Modal>
      </div>
    );
  }
}


ReactDOM.render(<App />, document.getElementById('root'));
